var app = new PIXI.Application({ width: 436, height: 653, transparent: true });
document.body.appendChild(app.view);

//app.stage.interactive = true;

var container = new PIXI.Container();
app.stage.addChild(container);

var displacementSprite = PIXI.Sprite.fromImage('https://res.cloudinary.com/dvxikybyi/image/upload/v1486634113/2yYayZk_vqsyzx.png');
displacementSprite.texture.baseTexture.wrapMode = PIXI.WRAP_MODES.REPEAT;

var displacementFilter = new PIXI.filters.DisplacementFilter(displacementSprite);

//displacementSprite.position.set(0, 325)

app.stage.addChild(displacementSprite);

container.filters = [displacementFilter];

displacementFilter.scale.x = 1500;
displacementFilter.scale.y = 1500;
displacementSprite.scale.set(0.6);
displacementSprite.anchor.set(0.5);

var bg = PIXI.Sprite.fromImage('data:image/jpeg;base64,');

bg.width = app.renderer.width;
bg.height = app.renderer.height;

bg.alpha = 1;

container.addChild(bg);

